import React from "react";

export default function Header() {
  return (

    <div className="header">
      <div className="head">
        <img className="head__logo" src="../assets/" alt="BrainFlix Logo" />
      </div>

      {/* searchbar section */}
      <div className="searchbar">
        <img className="searchbar__icon" src="" alt="search icon" />
        <input type="text" className="searchbar__input" placeholder="Search" />
      </div>

      {/* upload btn and user image */}
      <div className="user">
        <button className="user__upload-btn">+ UPLOAD</button>
        <img className="user__image" />
      </div>
    </div>
  );
}

